/*********************************************************************
*
*       MainTask
*/
void GUIDEMO_RadialMenu(void) {
  GUIDEMO_HideInfoWin();
  GUIDEMO_ShowIntro("Radial Menu",
                    "Selecting an icon from a radial menu.\n"
                    "Changing the selection is done\n"
                    "using STemWin motion support.");
  WM_MOTION_Enable(1);
  _RadialMenu();
  WM_MOTION_Enable(0);
}

